import React, { useState } from "react";
import { Link } from "react-router-dom";

function Navbar() {
  const [isAuthenticated, setIsAuthenticated] = useState(true); // Initial value, change as per authentication logic

  const handleSignOut = () => {
    // Logic for signing out the user, like clearing tokens
    setIsAuthenticated(false);
  };

  return (
    <nav className="bg-red-500 p-4">
      <div className="max-w-7xl mx-auto flex justify-between items-center">
        <Link to="/" className="text-red-100 font-bold text-xl">
          The Health Project
        </Link>
        <div className="space-x-4">
          {isAuthenticated ? (
            <>
              <Link to="/profile" className="text-red-100 hover:text-gray-300">
                Profile
              </Link>
              <button
                onClick={handleSignOut}
                className="text-red-100 hover:text-gray-300"
              >
                Sign Out
              </button>
            </>
          ) : (
            <>
              <Link to="/login" className="text-red-100 hover:text-gray-300">
                Login
              </Link>
              <Link to="/signup" className="text-red-100 hover:text-gray-300">
                Sign Up
              </Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
